import React, { Component } from 'react';
import NewSingle from './NewSingle';

class News extends Component {

    renderIterms() {
        return this.props.items.map((item) => (
            <NewSingle key={item.id} item={item} />
        ));
    }

    render() {
        return (
            <ul>
                {this.renderIterms()}
            </ul>
        )
    }
}

export default News;
